// This is a default image of the New York skyline in base 64. to be used when an image could not been loaded
 var defaultImage = "";

/*
 * This function turn on the requsted DIV and turn off all the other DIV's.
 * The lower nav bar and the upper header will always be shown.
 */
function switchPage(page) {
    $("#mainsearch").hide();
    $("#settings").hide();
    $("#list").hide();
    $("#notFound").hide();
    $("#onePlace").hide();
    $("#aroundMe").hide();
    $("#loading").hide();
    $("#header").show();
    $("#" + page).show();
    $("#footer").show();
    
}

/* This function is incharge of sending a search query to the server. 
 * the server will first search a specific place and if failed, will search a category.
 * If a specific place is found, the placePage function is called.
 * If a category is found it the buildList function is called. 
 * If nothing is found it the noSuchPlace function is called ---TO BE IMPLEMENTED---
 * */
function sendSearch(searchQuery) {
    $("#loading").show();
    
    if (searchQuery === "") {
        var searchQuery = $("#search-basic").val();
    }

    //document.getElementById("search-basic").value;
    $.ajax({
        method: 'POST',
        url: 'http://ranor.milab.idc.ac.il:8888',
        data: {
            reqString: "location_data",
            loc_name: searchQuery
        },
        success: function(data) {
            console.log(data);
            var status = data.Status;

            // In case search was successful
            if (status === "Success") {
                // In case a category was searched for
                if (data.Location_names.length > 1) {
                    buildList(data.Location_names, false);

                // In case a specific place was searched for
                } else {
                    placePage(data.Location_names[0].p_name, data.Location_names[0].meter, data.Location_names[0].image, data.Location_names[0].category);
                }

            // In case user search for non exciting place
            } else {
                placeNotFound();
            }
        },
        // In case of server error
        error: function() {
            alert("Error: Something went wrong!");
            $("#loading").hide();
        }
    }); 
}

/*
 * This function displays a page when a search was unsecsesful.
 */
function placeNotFound() {
    var items = [];
    items.push(
        "<center><table border=\"0\" width=\"90%\"><tr><td align=\"center\">" +
        "<p><font color=\"black\">Sorry but we could not find<br>what you were looking for</p>" + 
        "<p>We invite you to try one of our categories:</p>" +
        "<button class=\"ui-btn ui-shadow\" onClick=\"sendSearch('Museums')\">Museums</button>" +
        "<br><button class=\"ui-btn ui-shadow\" onClick=\"sendSearch('Attractions')\">Attractions</button>" +
        "<br><button class=\"ui-btn ui-shadow\" onClick=\"sendSearch('Markets & Shops')\">Markets & Shops</button></center></tr></td></table>");
    $("#notFound").html("");
    $(items.join("")).prependTo("#notFound");
    switchPage('notFound');
    $("#loading").hide(); 
}

/*
 * This fucntion build an html page of a list of place.
 * If 'distanceNeeded is TRUE than the 'around me' page is created.
 * Else, a list by category is created.
 */
function buildList(placeArray, distanceNeeded) {
    var nameOfPage;
    if (distanceNeeded) {
        nameOfPage = "aroundMe";
    } else {
        nameOfPage = "list";
    }
    switchPage(nameOfPage);
    $("#" + nameOfPage).html("");
    var items = [];
    items.push("<ul data-role=\"listview\" data-inset=\"true\">");
    $.each(placeArray, function(key, val) {

        // In case the place as no picture show defualt picture
        if (val.image === 0) {
            val.image = defaultImage;                    
        }
        items.push(
        // New list item
        "<li id='" + key + "'><div class=\"listdiv\">" + 

        // Link to the page of a certain place
        "<a href=\"#place\" onclick=\"placePage('" + val.p_name + "', '" + val.meter + "', '" + val.image + "')\">" +

        // Image of the place
        "<img class=\"imagelist\" usemap=\"#planetmap\" style='display:block; width:100%;height:185px;' id='image" + val.p_name + "' src='data:image/bmp;base64," + val.image + "' />" + 
        
        // White line seperator
        "<br><img src=\"images/whiteline.png\" style='width:100%; height:20px;'>" +
                
        // Name of the place
        "<p class=\"textlist\" style='position:relative; left:10px; top:-125px; z-index:1;'>" + val.p_name + "");
        
        if (distanceNeeded) {
            items.push("<br>" + val.distance.toFixed(2) + " miles</p>");
        } else {
            items.push("<br>&nbsp;</p>");
        }
        items.push(
        // Left middle and right side of the blue bar
        "<img src=\"images/bar/leftsideofbar.png\" border=\"0\" height=\"13\" style='position:relative; left:10px; top:-135px; z-index:2;'>" +
        "<img src=\"images/bar/middlebar.png\" border=\"0\" height=\"13\" width=\"" + val.meter * 2.3 + "\" style='position:relative; left:10px; top:-135px; z-index:2;'>" +
        "<img src=\"images/bar/rightsideofbar.png\" border=\"0\" height=\"13\" style='position:relative; left:10px; top:-135px; z-index:2;'><br>" +

        // Background of bar
        "<img src=\"images/bar/barbg.png\" height=\"19\" width=\"253\" style='position:relative; left:5px; top:-156px; z-index:1;'>" +

        // Precentage or Busy meter
        "<p style='position:relative; left:260px; top:-195px; z-index:1; font-color:#f7f7f7'>" + Math.round(val.meter) + "%");

    });

    items.push("</ul>");
    $(items.join("")).prependTo("#" + nameOfPage);
}

